import React from 'react';
import './AboutMe.css'; // Import CSS specific to this component
import iceland from './images/iceland.jpg'; // Replace with your image path

function About() {
  return (
    <div className='about'>
      <h1>About Me</h1>
      <div className='about__container'>
        <div className='about__wrapper'>
          <div className='about__items'>
            <img src={iceland} alt='Iceland' className='about__image' />
            <div className='about__info'>
              <h2 className='about__title'>UCSC Graduate</h2>
              <h3 className='about__subtitle'>Major in Computer Science</h3>
              <h3 className='about__subtitle'>Minor in Technology and Information Management</h3>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
